import ButtonAppBar from "./ButtonAppBar";

import Box from '@mui/material/Box';

const Notification = () => {
    return (
        <>
            <ButtonAppBar />
            <Box
                sx={{
                    width: 300,
                    height: 300,
                    backgroundColor: 'rgba(255, 236, 219, 0.7)',
                    boxShadow: 'rgba(0, 0, 0, 0.24) 0px 3px 8px;',                       

                }}
            />
        </>
    );
}

export default Notification;
